import React from 'react';
import Card from './Card';

const Cardlist = ( {cyclists} ) => {
	return (
		<div>
			<Card id={cyclists[0].id} name={cyclists[0].name} description={cyclists[0].description} img={cyclists[0].img} alt={cyclists[0].alt}/>
	    <Card id={cyclists[1].id} name={cyclists[1].name} description={cyclists[1].description} img={cyclists[1].img} alt={cyclists[1].alt}/>
	    <Card id={cyclists[2].id} name={cyclists[2].name} description={cyclists[2].description} img={cyclists[2].img} alt={cyclists[2].alt}/>
	    <Card id={cyclists[3].id} name={cyclists[3].name} description={cyclists[3].description} img={cyclists[3].img} alt={cyclists[3].alt}/>
	    <Card id={cyclists[4].id} name={cyclists[4].name} description={cyclists[4].description} img={cyclists[4].img} alt={cyclists[4].alt}/>
	    <Card id={cyclists[5].id} name={cyclists[5].name} description={cyclists[5].description} img={cyclists[5].img} alt={cyclists[5].alt}/>
	    <Card id={cyclists[6].id} name={cyclists[6].name} description={cyclists[6].description} img={cyclists[6].img} alt={cyclists[6].alt}/>
	    <Card id={cyclists[7].id} name={cyclists[7].name} description={cyclists[7].description} img={cyclists[7].img} alt={cyclists[7].alt}/>
    </div>
	);
}

export default Cardlist;
